import { Input, Table, Spacer, Button,Grid } from "@nextui-org/react";
import React from "react";
import TablaDatos from "./tablaDatos";
export default function ModalTipoDeDatos({valores}) {
  return (
    <div css={{
      Width: "100%",
    }}>
      <Grid.Container gap={2} justify="center" alignItems="flex-end">
      <Grid xs={6}>
        <Input label="Agregar Dato" placeholder="Ej: 9" type="number" size="lg" id="valor" />
      </Grid>
      <Grid xs={6}>

        <Button shadow color="success" auto id="AddValores">
          Agregar Valores
        </Button>
      </Grid>
      </Grid.Container>
      <Spacer y={2} />
      <TablaDatos valores={valores}/>
    </div>
  );
}
